import React from 'react';

import burgerLogo from '../../assets/images/burger-logo.png';
import classes from './Logo.module.css';

const logo = (props) => (
    <div 
        className={classes.Logo}
        style={{heigth: props.heigth}}
        >
        <img src={burgerLogo} alt="burgerLogo" />
    </div>
);

export default logo;
